class GeoLatestAnnouncementHandler extends elementorModules.frontend.handlers.Base{getDefaultSettings(){return{selectors:{announcement:".geo-latest-announcement"}}}getDefaultElements(){const e=this.getSettings("selectors");return{$announcement:this.$element.find(e.announcement)}}onInit(){super.onInit(),this.fetchLatestAnnouncement()}fetchLatestAnnouncement(){const e=this.elements.$announcement.data("lang"),n=geo.geocoreApiUrl+"/announcements?lang="+e;fetch(n).then(e=>e.json()).then(n=>{let t=n.Items;if(t.length){let n=t.pop(),o="announcement_"+e;if("n/a"==n[o])return;this.elements.$announcement.html(n[o]).slideDown()}}).catch(e=>{console.error("Error:",e)})}}jQuery(window).on("elementor/frontend/init",e=>{elementorFrontend.elementsHandler.attachHandler("geo-latest-announcement",GeoLatestAnnouncementHandler)});